import React from "react";
import MuzicaPopBodyCard from "./MuzicaPopBodyCard.jsx";
import background from "./../../media/images/BK/Concert6.jpg";

const MuzicaPop = () => {
  return (
    <>
      <div
        style={{
          backgroundImage: `url(${background})`,
          backgroundSize: "210%",
          width: "100vw",
          height: "140vw",
        }}
      >
        <h1 className="row d-flex justify-content-center text-white">
          <p style={{ height: "25px" }}></p>Muzica Pop
        </h1>
        <MuzicaPopBodyCard></MuzicaPopBodyCard>
      </div>
    </>
  );
};

export default MuzicaPop;
